/// <summary>
/// If the task is edit or create new record show the actual field.
/// </summary>
/// <param name = "_p1">The task identifier.</param>
/// <returns></returns>
public int task(int _p1)
{
    #task;
    int ret;
    ret = super(_p1);
    if (_p1 == #taskEditRecord || _p1 == #taskNew)
    {
        DetailsHeader_RetailSchedulerJobTable_TranslatedDescription.visible(false);
        DetailsHeader_RBOSchedulerJobTable_description.visible(true);
    }
    else
    {
        DetailsHeader_RetailSchedulerJobTable_TranslatedDescription.visible(true);
        DetailsHeader_RBOSchedulerJobTable_description.visible(false);
    }

    return ret;
}

public boolean validateWrite()
{
    RetailConnSchedulerSubjobTable subjob;
    RetailConnSchedulerJobLine jobLine;
    boolean ret;

    ret = super();

    select firstOnly SubJobID from jobLine
        where jobLine.jobId == RetailConnSchedulerJobTable.jobId
    exists join subjob
        where subjob.subJobId == jobline.subJobId
           && subjob.dataReplicationByPull != RetailConnSchedulerJobTable.IsUpload;

    if (jobLine)
    {
        error(strFmt("@REX4520099", jobLine.subJobId, RetailConnSchedulerJobTable.jobId));
        ret = false;
    }

    return ret;
}

