/// Enable disable control
/// </summary>
/// <returns>Other than zero</returns>
public int active()
{
    int ret;

    ret = super();

    if (ret)
    {
        RetailConnSchedulerJobTable_AllowSkipDataSync.visible(!retailConnSchedulerJobTable.IsUpload);
        allowSkipDataSync.visible(!retailConnSchedulerJobTable.IsUpload);
    }

    return ret;
}

