void clicked()
{
    RetailConnSchedulerJobTable    tSchedulerJobTable;
;
    // copy job
    tSchedulerJobTable.data(RetailConnSchedulerJobTable::duplicateDRMSchedulerJobTable(retailConnSchedulerJobTable.JobId));

    if (tSchedulerJobTable.RecId != RetailConnSchedulerJobTable.RecId)
    {
        // copy job-subjob association only if duplication of job was successful (it may fail if user cancels out of pop-up dialog)
        RetailConnSchedulerJobLine::duplicateDRMSchedulerJobLine(retailConnSchedulerJobTable.JobId, tSchedulerJobTable.JobId);

        retailConnSchedulerJobTable_ds.research();
    }
    super();
}

public void clicked()
{
    boolean shouldPromptWhenDeletingCoreSubjobs = RetailCdxPromptWhenDeletingCoreSubjobsFlight::instance().isEnabled();

    if (!shouldPromptWhenDeletingCoreSubjobs)
    {
        super();
    }
    else if (Box::confirm("@Retail:RetailConnSchedulerJobLinesDelete"))
    {
        MultiSelectionHelper selectionHelper = MultiSelectionHelper::construct();
        selectionHelper.parmDataSource(RetailConnSchedulerJobLine_ds);
        RetailConnSchedulerJobLine selectedJobLine = selectionHelper.getFirst();

        while (selectedJobLine)
        {
            RetailConnSchedulerSubjobTable subjobtable = RetailConnSchedulerSubjobTable::find(selectedJobLine.subJobId);

            // Check if channel table name starts with 'ax.'
            if (subjobtable && match('<ax\\.', subJobTable.ChannelTableName))
            {
                if (Box::confirm(strfmt("@Retail:RetailConnSchedulerJobLineDeleteDialog", selectedJobLine.subJobId)))
                {
                    selectedJobLine.delete();
                }
            }
            else
            {
                selectedJobLine.delete();
            }

            selectedJobLine = selectionHelper.getNext();
        }

        RetailConnSchedulerJobLine_ds.research(true);
    }
}

public void clicked()
{
    boolean confirmResult = Box::confirm("@RetailCDX:ChangeWillAffectAllJobsWithSameSubjobs");
    if (confirmResult)
    {
        MultiSelectionHelper    selectionHelper = MultiSelectionHelper::construct();
        selectionHelper.parmDataSource(RetailConnSchedulerJobLine_ds);
        RetailConnSchedulerJobLine selectedJobLine = selectionHelper.getFirst();

        ttsbegin;
        while (selectedJobLine)
        {
            RetailConnSchedulerSubjobTable  subJobTable;
            select forupdate subJobTable where subJobTable.subJobId == selectedJobLine.subJobId;

            subJobTable.AllowSkipDataSync = NoYes::Yes;
            subJobTable.ManuallyChanged = NoYes::Yes;
            subJobTable.update();

            selectedJobLine = selectionHelper.getNext();
        }
        ttscommit;

        RetailConnSchedulerJobLine_ds.research(true);
    }

    super();
}

public void clicked()
{
    boolean confirmResult = Box::confirm("@RetailCDX:ChangeWillAffectAllJobsWithSameSubjobs");
    if (confirmResult)
    {
        MultiSelectionHelper    selectionHelper = MultiSelectionHelper::construct();
        selectionHelper.parmDataSource(RetailConnSchedulerJobLine_ds);
        RetailConnSchedulerJobLine selectedJobLine = selectionHelper.getFirst();

        ttsbegin;
        while (selectedJobLine)
        {
            RetailConnSchedulerSubjobTable  subJobTable;
            select forupdate subJobTable where subJobTable.subJobId == selectedJobLine.subJobId;

            subJobTable.AllowSkipDataSync = NoYes::No;
            subJobTable.ManuallyChanged = NoYes::Yes;
            subJobTable.update();

            selectedJobLine = selectionHelper.getNext();
        }
        ttscommit;

        RetailConnSchedulerJobLine_ds.research(true);
    }

    super();
}

public void clicked()
{
    super();

    boolean confirmResult = Box::confirm("@RetailCDX:ChangeWillAffectAllJobsWithSameSubjobs");

    if (confirmResult)
    {
        retailConnSchedulerJobTable.selectAllSubjobsToSkipDataSync();

        RetailConnSchedulerJobLine_ds.research(true);
    }
}

public void clicked()
{
    super();

    boolean confirmResult = Box::confirm("@RetailCDX:ChangeWillAffectAllJobsWithSameSubjobs");

    if (confirmResult)
    {
        retailConnSchedulerJobTable.clearAllSubjobsToSkipDataSync();

        RetailConnSchedulerJobLine_ds.research(true);
    }
}

public void lookup()
{
    Query query = new Query();
    QueryBuildDataSource queryBuildDataSource;
    QueryBuildRange queryBuildRange,queryBuildSchemaRange;

    SysTableLookup sysTableLookup = SysTableLookup::newParameters(tableNum(RetailConnSchedulerSubjobTable), this);
    sysTableLookup.addLookupField(fieldNum(RetailConnSchedulerSubjobTable, SubJobID));
    sysTableLookup.addLookupField(fieldNum(RetailConnSchedulerSubjobTable, Name));
    queryBuildDataSource = query.addDataSource(tableNum(RetailConnSchedulerSubjobTable));
    queryBuildSchemaRange      = queryBuildDataSource.addRange(fieldNum(RetailConnSchedulerSubjobTable, RetailConnChannelSchema));
    queryBuildSchemaRange.value(queryValue(RetailConnSchedulerJobTable.RetailConnChannelSchema));
    queryBuildRange      = queryBuildDataSource.addRange(fieldNum(RetailConnSchedulerSubjobTable, dataReplicationByPull));
    queryBuildRange.value(queryValue(RetailConnSchedulerJobTable.IsUpload));
    sysTableLookup.parmQuery(query);
    sysTableLookup.performFormLookup();
}

/// <summary>
/// Validates if the checkbox can be changed.
/// </summary>
/// <returns>True if the checkbox can be changed; otherwise false.</returns>
public boolean validate()
{
    boolean ret;

    ret = super();

    if (ret)
    {
       boolean confirmResult = Box::confirm("@RetailCDX:ChangeWillAffectAllJobsWithSameSubjobs");

       ret = ret && confirmResult;
    }

    return ret;
}
